import icons from "./icon";

const {
  MdOutlineLibraryMusic,
  RiDonutChartLine,
  FcLineChart,
  PiMusicNotesPlus,
  MdOutlineCategory,
  AiOutlineStar
} = icons;
export const sidbarMenu = [
  {
    path: "my-music",
    test: "Thư Viện",
    icons: <MdOutlineLibraryMusic size={24} />,
  },
  {
    path: "",
    test: "Khám phá",
    icons: <RiDonutChartLine  />,
  },
  {
    path: "zing-chart",
    test: "#zingchart",
    icons: <FcLineChart />,
  },
  {
    path: "moi-phat-hanh",
    test: "BXH Nhạc Mới",
    icons: <PiMusicNotesPlus />,
  },
  {
    path: "hub",
    test: "Chủ Đề & Thể Loại",
    icons: <MdOutlineCategory />,
  },
  {
    path: "top100",
    test: "Top 100",
    icons: <AiOutlineStar />,
  },
];

export default sidbarMenu;
